import React from 'react';

import Showcase from '../../components/layouts/footer/';
import Footer from '../../components/layouts/footer/Footer';
import Productlist from '../../components/layouts/footer/Footer';

const HomePage= ()=>{
    return(
    
        <div>
        <section className='showcase-container'>
        <Showcase/> 
        </section>   
        <Productlist/>
        <Footer/>
           
        </div>
    )
}
export default HomePage;
